import requests
import time
import json

# Define the URL of your endpoint
url = 'http://65.0.133.192:5001/process_image'

# Define the JSON request body
json_body = {
    "base64_image": ""
}

# Number of requests to make
num_requests = 10

# File to save the responses and timings
output_file = 'response_times.txt'

with open(output_file, 'w') as file:
    for i in range(num_requests):
        start_time = time.time()
        
        try:
            # Send POST request to the endpoint
            response = requests.post(url, json=json_body)
            end_time = time.time()
            
            # Calculate the time taken
            time_taken = end_time - start_time
            
            # Get the response content
            response_content = response.json()
            
            # Write response and time taken to the file
            file.write(f"Request {i + 1}:\n")
            file.write(f"Time taken: {time_taken:.4f} seconds\n")
            file.write(f"Response: {json.dumps(response_content, indent=2)}\n\n")
            
            print(f"Request {i + 1} completed in {time_taken:.4f} seconds")
        
        except requests.RequestException as e:
            # Handle any request-related errors
            file.write(f"Request {i + 1} failed:\n")
            file.write(f"Error: {str(e)}\n\n")
            print(f"Request {i + 1} failed: {str(e)}")

print(f"Responses and times saved to {output_file}")